import { Link } from 'react-router-dom';

export default function Home() {
  return (
    <div className="flex flex-col items-center justify-center min-h-screen text-center p-6">
      <h1 className="text-4xl font-bold mb-4">Welcome to Room Booking App</h1>
      <p className="text-lg mb-6">Book your stay easily and quickly</p>
      <Link
        to="/booking"
        className="bg-blue-500 text-white px-6 py-3 rounded-xl hover:bg-blue-600 transition"
      >
        Go to Booking
      </Link>
    </div>
  );
}
